import React from 'react';
import styled from 'styled-components';
import {Facebook, Pinterest, Twitter, Instagram} from '@material-ui/icons';

const Container = styled.div`
  display: flex;
`
const Left = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  padding: 20px;
`

const Logo = styled.h1``

const Description = styled.p`
  margin: 20px 0px;
`

const SocialContainer = styled.div`
  display: flex;
`

const SocialIcon = styled.div`
  width: 40px;
  height: 40px;
  border-radius: 50%;
  background-color: #${props => props.color};
  color: white;

  display: flex;
  align-items: center;
`

const Center = styled.div`
  flex: 1;
`

const Right = styled.div`
  flex: 1;
`

const Footer = () => {
  return (
    <Container>
      <Left>
        <Logo>BOUTIQUE.</Logo>
        <Description>
          Customer-focused team players are becoming actionable capability experts.
          Our Corporate Enterprise solution offers low hanging fruit a suite of end-to-end offerings.
          We aim to proactively virtualise our cloud by globally incentivizing our world-class wholesale alignments.
          Going forward, our next-generation industry leader will deliver value to prince2 practitioners.
        </Description>
        <SocialContainer>
          <SocialIcon color='3b5999'>
            <Facebook/>
          </SocialIcon>
          <SocialIcon color='e4405f'>
            <Instagram/>
          </SocialIcon>
          <SocialIcon color='55acee'>
            <Twitter/>
          </SocialIcon>
          <SocialIcon color='e60023'>
            <Pinterest/>
          </SocialIcon>
        </SocialContainer>
      </Left>
      <Center>Center</Center>
      <Right>Right</Right>
    </Container>
  )
}

export default Footer;
